function Menu() {
  return (
    <ul>
      <li><a href='/' ><button><Menu></Menu></button></a></li>  
      <li><a href='/about-us' ><button>About us</button></a></li>  
      <li><a href='/contact-us' ><button>contact us</button></a></li>  
    </ul>
  )
}

export default Menu
